import React from "react"


function Header() {
    return (
        <header className="navbar">
            <div className="pure-g">
                <div className="pure-u-1 pure-u-md-1-3"><img src="./public/examapp-logo.png" alt="Examapp"></img></div>
                <div className="pure-u-1 pure-u-md-1-3"></div>
                <div className="pure-u-1 pure-u-md-1-3"><button>Logout</button></div>
            </div>
        </header>
    )
}

export default Header
